import { Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Contact from './pages/Contact';
import About from './pages/About';


function App() {
  return (
    <div>
      <Navbar />
      <Route path="/">
        <Home/>
      </Route>

      <Route>
        <Contact path="/contact"/>
      </Route>

      <Route  path="/cbout">
        <About/>
      </Route>

    </div>
  );
}

export default App;
